import React from "react";
import { Col, Card, Row } from "react-bootstrap";

function Cardie (){
    return(
        <div>
            <Card>
                <h1>apple</h1>
            </Card>
        </div>
    )
}

const Footer = () => {
    return ( 
        <Row>
            <Col style={{background: "black", position: "absolute", paddingTop: "100pt", paddingBottom: "100pt", left:"0" , right:"0"}}>
                <Cardie />  
            </Col>
        </Row>
     );
}

export default Footer;
